PEラインとは異なる次世代のスーパーラインの登場です。 従来のファイヤーラインに比べ、約17%の飛距離アップを実現(当社比) PEラインが編み込みの緩みによる伸び、感度低下が起こるのに対し、スーパーファイヤーラインは、ダイニーマ素材をマイクロフューズド製法により熱を掛けて直線方向にそろえて延伸し、超低震度特性を最大限に引き出す加工をしている為、通常のPEラインに比べ圧倒的な低伸度を記録。 自社テストでは他社PEラインに比べて約50%の低伸度を記録しています。 これにより圧倒的な感度の差がうまれました。 また、従来のPEラインに比べて根ズレに強いと評判だったファイヤーラインの摩耗性についても、コーティング技術の進化から更に耐摩耗性がアップ。 従来のファイヤーラインに比べて毛羽立ちにくくなっています さらに直線強度でも日本釣用品工業会の定めたPEラインの太さ基準規格を基に他社製PEラインと比較した結果、直線強度において最大127%の強さを実現 より細いラインで大物とのファイトを可能にしています。<style>
